import FormList from '../FormList';

const lista = () => {
    let array = ['Gina', 'Pina', 'Maria', 'Minu', 'Peppe', 'Ciccio'];

    return <>
        <ul>
        <FormList listaProps={array} />
        </ul>
    </>
}
export default lista;
